import axios from "axios";
import React, { useEffect, useState } from "react";

function AccountEntitlement() {
  const intialData = {
    userName: "",
    password: "",
    role: "",
    name: "",
  };
  const [values, setValue] = useState(intialData);
  const handleChange = (name, e) => {
    e.preventDefault();

    setValue((prevalue) => {
      return {
        ...prevalue,
        [name]: e.target.value,
      };
    });
  };
  useEffect(() => {
    getDetails();
  }, []);
  const getDetails = () => {
    axios.get(`http://localhost:3333/getAllUserDetails`).then((res) => {
      console.log("res: ", res);
      console.log(res.data);
      if (res.status === 200) setValue(intialData);
    });
  };

  return (
    <div>
      <h2>Account Entitlement</h2>
      <div className="container">
        <div className="row">
          <div className="col"></div>
          <div className="col">
            List
            <div></div>
          </div>
          <div className="col"></div>
        </div>
      </div>
    </div>
  );
}

export default AccountEntitlement;
